//   }

  const [employeeList, setEmployeeList] = useState([])

  useEffect(function() 
  {
    fetch("http://localhost:42069/Employee", {
        method: "GET",
        mode: "cors"
    })
      .then(function(data) {
        return data.json();
      })
      .then(function(json) {
        setEmployeeList(json)     
      }).catch((error) => {
        console.log(error);
      });
  }, [setEmployeeList])

